import React, { ChangeEvent, useState } from 'react';

import { useFormik } from 'formik';
import { Button, Card, Divider, Form, Input, Select } from 'antd';

import PimageLoader from '../../../pages/desease-predictors/PimageLoader';
import { usePageData } from '../../../hooks/usePage';
import { useGetUser } from '../../../hooks/useGetUser';

import { IPageData } from '../../../interfaces/page';
import { IPatient } from '../../../interfaces/patient';
import FormItem from 'antd/lib/form/FormItem';

const pageData: IPageData = {
    title: 'Tuberculosis Predictor',
    fulFilled: true,
    breadcrumbs: [
        {
            title: 'Home',
            route: 'default-dashboard'
        },
        {
            title: 'Tuberculosis Predictor'
        }
    ]
};

const UserAvatar = ({ src, className = null }) => {
    return (
        <div className={`avatar-wrapper ${className}`}>
            <PimageLoader />
        </div>
    );
};

const PredictorForm = () => {
    usePageData(pageData);

    const [dataSource, setDataSource] = useState([]);

    const handleSearch = (value) =>
        setDataSource(!value ? [] : [value, value + value, value + value + value]);

    const [radioValue, setRadioValue] = useState(1);

    const handleRadioChange = (e) => setRadioValue(e.target.value);

    return (
        <>

            <Card title='With labels'>
                <Form layout='vertical'>
                    <Form.Item label='Patient'>
                        <Input placeholder='First name' />
                    </Form.Item>
                    <Form.Item label='Symptoms'>
                        <Input placeholder='Last name' />
                    </Form.Item>
                    <Form.Item label='Allergies'>
                        <Input placeholder='Email' />
                    </Form.Item>
                    <Form.Item label='something'>
                        <Input placeholder='Password' />
                    </Form.Item>
                    <Form.Item>
                        <Button type='primary'>Submit</Button>
                    </Form.Item>
                </Form>
            </Card>
        </>
    );
};




const TuberculosisPredictorPage = () => {
    const user = useGetUser();
    usePageData(pageData);
    return (
        <div className='stack' style={{ maxWidth: 690, margin: '0 auto' }}>
            <UserAvatar className='mt-0' src={user.img} />
            <PredictorForm/>
            <Divider />
        </div>
    );
};


export default TuberculosisPredictorPage;
